import ReactDOM from "react-dom";
import { BrowserRouter } from "react-router-dom";

import "./index.css";
import App from "./App";
import Form from "./component1/Form";

ReactDOM.render(
  <>
    <BrowserRouter>
      <App />
    </BrowserRouter>
    ,
    <BrowserRouter>
      <Form />
    </BrowserRouter>
    document.getElementById("root")
  </>
);
